void mis_task::thread_ap_clk_no_reset_() {
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_CS_fsm = ap_ST_fsm_state1;
    } else {
        ap_CS_fsm = ap_NS_fsm.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state22.read()) && esl_seteq<1,1,1>(icmp_ln879_reg_310.read(), ap_const_lv1_1) && !(esl_seteq<1,1,1>(ap_const_logic_0, l1_V_BVALID.read()) || esl_seteq<1,1,1>(ap_const_boolean_1, ap_block_state22_io.read())))) {
        add_ln1503_reg_314 = add_ln1503_fu_233_p2.read();
        trunc_ln176_reg_319 = trunc_ln176_fu_239_p1.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state8.read()) && esl_seteq<1,1,1>(l1_V_RVALID.read(), ap_const_logic_1))) {
        base_flags_V = l1_V_RDATA.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state9.read())) {
        base_flags_V_load_reg_287 = base_flags_V.read();
        l1_V_addr_1_reg_292 =  (sc_lv<32>) (sext_ln544_fu_199_p1.read());
        vid_V_reg_281 = task_in.read().range(63, 32);
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state17.read()) && !(esl_seteq<1,1,1>(ap_const_logic_0, l1_V_RVALID.read()) || esl_seteq<1,1,1>(ap_const_logic_0, l1_V_WREADY.read())))) {
        cur_flag_V_reg_305 = l1_V_RDATA.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state18.read())) {
        icmp_ln879_reg_310 = icmp_ln879_fu_216_p2.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && esl_seteq<1,1,1>(ap_const_lv1_0, initialized_V.read()) && !(esl_seteq<1,1,1>(ap_const_logic_0, ap_start.read()) || esl_seteq<1,1,1>(ap_const_boolean_1, ap_block_state1_io.read())))) {
        initialized_V = ap_const_lv1_1;
    }
}

